import React, { useEffect } from "react";
import NewsCard from "../Cards/News-Card.jsx";
import ViewAllButton from "../Buttons/View-All-Btn.jsx";
import FilterButton from "../Buttons/Filter-Btn.jsx";
import { useInfiniteFetch } from "api/custom-hooks.js";
import EventCard from "component/Cards/Event-Card.jsx";
import TeamCard from "component/Cards/Team-Card.jsx";

const GridCards = ({
    toFetchedData = {},
    url = "",
    filter = null,
    useFilterButton = false,
    fetchedLabData = [],
    publicationLink = null,
}) => {
    const [selectedLab, setSelectedLab] = React.useState(null);

    const finalFilter = selectedLab
        ? { laboratory_id: selectedLab.Laboratory.LID }
        : filter;

    const {
        data,
        isLoading,
        isError,
        fetchNextPage,
        isFetchingNextPage,
        hasNextPage,
    } = useInfiniteFetch({
        id: toFetchedData.id,
        url: url,
        pageSize: toFetchedData.pageSize,
        filter: finalFilter,
    });

    useEffect(() => {
        if (data) {
            console.log("Fetched data:", data);
        }
    }, [data]);

    // Safely determine the topic from the first item
    const topic = data?.pages?.[0]?.[0]
        ? Object.keys(data.pages[0][0])[0]
        : undefined;

    // Check if we have any data across all pages
    const hasData =
        data?.pages?.some((page) => Array.isArray(page) && page.length > 0) ||
        false;

    const handleLabChange = (event) => {
        setSelectedLab(event);
    };

    if (isError) {
        return (
            <section className="flex flex-col p-8 bg-gray-100">
                <div className="text-red-500">
                    Error loading data. Please try again later.
                </div>
            </section>
        );
    }

    const getGridTemplateColumns = () => {
        if (topic === "Researcher" || topic === "Publication") {
            return "repeat(auto-fill, minmax(280px, 1fr))";
        }
        return "repeat(auto-fill, minmax(280px, 1fr))";
    };

    const renderCard = (item, pageIndex, itemIndex) => {
        const topicData = item[topic];
        const resolvedID = {
            News: topicData?.NID,
            Laboratory: topicData?.LID,
            Research: topicData?.RID,
            Publication: topicData?.PID,
        }[topic];

        if (!topicData) return null;

        if (topic === "Event") {
            return (
                <div
                    key={`${pageIndex}-${itemIndex}`}
                    className="col-span-full w-full -my-10"
                >
                    <EventCard {...topicData} ID={resolvedID} />
                </div>
            );
        }

        if (topic === "Researcher") {
            return (
                <TeamCard key={`${pageIndex}-${itemIndex}`} {...topicData} />
            );
        }

        return (
            <NewsCard
                key={`${pageIndex}-${itemIndex}`}
                {...topicData}
                type={topic}
                ID={resolvedID}
                publicationLink={publicationLink}
            />
        );
    };

    return (
        <section className="flex overflow-hidden flex-col px-16 py-28 w-full -mt-40 bg-gray-100 max-md:px-5 max-md:py-24 max-md:max-w-full">
            <div className="flex flex-wrap gap-10 justify-between items-end w-full max-md:max-w-full">
                <div className="flex flex-col text-black min-w-[240px] w-[325px] max-md:max-w-full" />
                <div className="flex items-center gap-4">
                    {useFilterButton && (
                        <FilterButton
                            fetchedLabData={fetchedLabData}
                            setSelectedLab={handleLabChange}
                        />
                    )}
                </div>
            </div>

            <div className="flex flex-col mt-6 w-full max-md:mt-5 max-md:max-w-full">
                <div className="box-border flex relative flex-col shrink-0">
                    <div className="w-full max-md:max-w-full mt-4">
                        {isLoading ? (
                            <div className="flex justify-center items-center p-8">
                                <div className="text-gray-600">Loading...</div>
                            </div>
                        ) : !hasData ? (
                            <div className="flex justify-center items-center p-8">
                                <div className="text-gray-600">
                                    No data available
                                </div>
                            </div>
                        ) : (
                            <div
                                className={`grid grid-flow-row auto-rows-auto my-10 ${
                                    topic === "Researcher" ||
                                    topic === "Publication"
                                        ? "gap-y-10"
                                        : "gap-y-20"
                                }`}
                                style={{
                                    gridTemplateColumns:
                                        getGridTemplateColumns(),
                                }}
                            >
                                {data.pages.map((itemArr, pageIndex) =>
                                    itemArr.map((item, itemIndex) =>
                                        renderCard(item, pageIndex, itemIndex)
                                    )
                                )}
                            </div>
                        )}
                    </div>
                </div>
            </div>

            {hasData && hasNextPage && (
                <button
                    onClick={() => hasNextPage && fetchNextPage()}
                    disabled={isFetchingNextPage}
                    className={`px-8 py-5 mt-8 w-full text-lg border rounded-2xl border-solid max-md:px-5 max-md:max-w-full transition duration-300 ease-in-out transform ${
                        isFetchingNextPage
                            ? "bg-gray-400 text-gray-700 cursor-not-allowed"
                            : "bg-blue-500 text-white hover:bg-blue-600 hover:scale-105"
                    }`}
                >
                    {isFetchingNextPage ? "Loading more..." : "Load More"}
                </button>
            )}
        </section>
    );
};

export default GridCards;
